import react from "react";
function SendMailForm() {
  return (
    <form>
      <input type="text" placeholder="Type Message Here" />
      <input type="email" placeholder="Enter your Email here" />
      <button>Submit</button>
    </form>
  );
}
export default SendMailForm;
